// App.js
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import RegistrationScreen from './screen/RegistrationScreen';
import LoginScreen from './screen/LoginScreen';
import GetStartedScreen from './screen/GetStartedScreen'; // Import the GetStartedScreen component
import HomeScreen from './screen/HomeScreen';
import ProductDetailScreen from './screen/ProductDetailScreen';
import ProductPhotos from './screen/ProductPhotos';


const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="GetStarted">
        <Stack.Screen
          name="GetStarted"
          component={GetStartedScreen}
          options={{ headerShown: false }} // Hide header for GetStartedScreen
        />
        <Stack.Screen
          name="Register"
          component={RegistrationScreen}
          options={{ headerShown: false }} // Hide header for RegistrationScreen
        />
        <Stack.Screen
          name="Login"
          component={LoginScreen}
          options={{ headerShown: false }} // Hide header for LoginScreen
        />
        <Stack.Screen
          name="Home"
          component={HomeScreen} // Use the Home component
          options={{ headerShown: false }}
        />

        <Stack.Screen
          name="prod"
          component={ProductDetailScreen} // Use the Home component
          options={{ headerShown: false }}
        />





      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
